namespace RonSijm.FluidHumidifier.Factories.DataPipeline;

public class PipelineFactory(string resourceName = null, Action<Humidifier.DataPipeline.Pipeline> factoryAction = null) : ResourceFactory<Humidifier.DataPipeline.Pipeline>(resourceName)
{

    internal List<InnerPipelinePipelineTagFactory> PipelineTagsFactories { get; set; } = [];

    internal List<InnerPipelineParameterObjectFactory> ParameterObjectsFactories { get; set; } = [];

    internal List<InnerPipelinePipelineObjectFactory> PipelineObjectsFactories { get; set; } = [];

    internal List<InnerPipelineParameterValueFactory> ParameterValuesFactories { get; set; } = [];

    protected override Humidifier.DataPipeline.Pipeline Create()
    {
        var pipelineResult = CreatePipeline();
        factoryAction?.Invoke(pipelineResult);

        return pipelineResult;
    }

    private Humidifier.DataPipeline.Pipeline CreatePipeline()
    {
        var pipelineResult = new Humidifier.DataPipeline.Pipeline
        {
            GivenName = InputResourceName,
        };

        return pipelineResult;
    }
    public override void CreateChildren(Humidifier.DataPipeline.Pipeline result)
    {
        base.CreateChildren(result);

        result.PipelineTags = PipelineTagsFactories.Any() ? PipelineTagsFactories.Select(x => x.Build()).ToList() : null;
        result.ParameterObjects = ParameterObjectsFactories.Any() ? ParameterObjectsFactories.Select(x => x.Build()).ToList() : null;
        result.PipelineObjects = PipelineObjectsFactories.Any() ? PipelineObjectsFactories.Select(x => x.Build()).ToList() : null;
        result.ParameterValues = ParameterValuesFactories.Any() ? ParameterValuesFactories.Select(x => x.Build()).ToList() : null;
    }

} // End Of Class

